import React, { useState } from "react";
import {
  Grid,
  Card,
  CardContent,
  CardMedia,
  Typography,
  Modal,
  Box,
  Badge,
  Button,
  TextField,
  InputAdornment,
  IconButton,
  AppBar,
  Toolbar,
  Fab,
} from "@mui/material";
import { Search,  ShoppingCart, RemoveShoppingCart, Add } from "@mui/icons-material";

const Marketplace = () => {
  const [searchQuery, setSearchQuery] = useState("");
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [openModal, setOpenModal] = useState(false);
  const [cart, setCart] = useState([]);
  const [cartOpen, setCartOpen] = useState(false);
  const [addModalOpen, setAddModalOpen] = useState(false);
  const [products, setProducts] = useState([
  {
    listing_id: 1,
    seller_id: 101,
    title: "Wireless Bluetooth Headphones",
    description: "Noise-canceling over-ear headphones with 40-hour battery life.",
    price: 59.99,
    category: "Electronics",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-04-01T10:00:00Z",
    updated_at: "2025-04-02T12:00:00Z",
  },
  {
    listing_id: 2,
    seller_id: 102,
    title: "Ergonomic Office Chair",
    description: "Adjustable office chair with lumbar support and breathable mesh.",
    price: 129.99,
    category: "Furniture",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-28T09:30:00Z",
    updated_at: "2025-04-03T15:45:00Z",
  },
  {
    listing_id: 3,
    seller_id: 103,
    title: "Smartphone - 128GB",
    description: "Latest model with AMOLED display, 128GB storage, and 5G support.",
    price: 699.99,
    category: "Electronics",
    is_active: false,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-25T14:10:00Z",
    updated_at: "2025-04-01T08:00:00Z",
  },
  {
    listing_id: 4,
    seller_id: 104,
    title: "Running Shoes",
    description: "Lightweight, breathable running shoes for long-distance comfort.",
    price: 79.99,
    category: "Sportswear",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-04-02T11:20:00Z",
    updated_at: "2025-04-04T16:30:00Z",
  },
  {
    listing_id: 5,
    seller_id: 105,
    title: "Gaming Keyboard",
    description: "RGB backlit mechanical keyboard with customizable macros.",
    price: 89.99,
    category: "Gaming",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-29T13:45:00Z",
    updated_at: "2025-04-02T10:10:00Z",
  },
  {
    listing_id: 6,
    seller_id: 106,
    title: "4K Ultra HD Smart TV",
    description: "55-inch 4K UHD Smart TV with HDR and built-in streaming apps.",
    price: 499.99,
    category: "Electronics",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-31T08:00:00Z",
    updated_at: "2025-04-02T14:15:00Z",
  },
  {
    listing_id: 7,
    seller_id: 107,
    title: "Mountain Bike",
    description: "21-speed lightweight mountain bike with durable frame and suspension.",
    price: 349.99,
    category: "Sports",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-27T12:45:00Z",
    updated_at: "2025-04-01T11:30:00Z",
  },
  {
    listing_id: 8,
    seller_id: 108,
    title: "Leather Wallet",
    description: "Genuine leather wallet with RFID blocking technology.",
    price: 39.99,
    category: "Accessories",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-04-01T09:15:00Z",
    updated_at: "2025-04-03T17:40:00Z",
  },
  {
    listing_id: 9,
    seller_id: 109,
    title: "Coffee Maker",
    description: "Programmable coffee maker with built-in grinder and milk frother.",
    price: 149.99,
    category: "Home Appliances",
    is_active: false,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-26T15:20:00Z",
    updated_at: "2025-04-01T13:00:00Z",
  },
  {
    listing_id: 10,
    seller_id: 110,
    title: "Electric Guitar",
    description: "Solid-body electric guitar with maple neck and dual humbuckers.",
    price: 399.99,
    category: "Music",
    is_active: true,
    image_url: "data:image/jpeg;base64,",
    created_at: "2025-03-30T10:30:00Z",
    updated_at: "2025-04-02T18:10:00Z",
  },
]);
const [newProduct, setNewProduct] = useState({
  title: "",
  description: "",
  price: "",
  image_url: "",
});
const filteredProducts = products.filter(
  (product) =>
    product.is_active &&
    product.title.toLowerCase().includes(searchQuery.toLowerCase())
);


const handleOpenModal = (product) => {
  setSelectedProduct(product);
  setOpenModal(true);
};

const handleCloseModal = () => setOpenModal(false);

const addToCart = (product) => {
  setCart((prev) => [...prev, product]);
};

const removeFromCart = (id) => {
  setCart((prev) => prev.filter((item) => item.listing_id !== id));
};
const handleAddProduct = () => {
  if (!newProduct.title || !newProduct.description || !newProduct.price || !newProduct.image_url) {
    alert("Please fill in all fields.");
    return;
  }

  const newEntry = {
    ...newProduct,
    is_active: true,
    price: parseFloat(newProduct.price),
    listing_id: Date.now(),
  };

  setProducts((prev) => [...prev, newEntry]);
  setNewProduct({ title: "", description: "", price: "", image_url: "" });
  setAddModalOpen(false);
};

return (
  <div style={{ backgroundColor: "#1B263B", minHeight: "92vh", color: "white", padding: "20px" }}>
    <AppBar position="static" sx={{ backgroundColor: "#1B263B", padding: "10px", boxShadow: "none" }}>
      <Toolbar>
        <Typography variant="h4" sx={{ flexGrow: 1, fontWeight: "bold" }}>
          Marketplace
        </Typography>
        <TextField
          variant="outlined"
          placeholder="Search Marketplace"
          size="small"
          sx={{ backgroundColor: "#2A3B5D", borderRadius: "8px", input: { color: "white" }, width: "40%" }}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <Search sx={{ color: "gray" }} />
              </InputAdornment>
            ),
          }}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <IconButton sx={{ color: "white", marginLeft: "10px" }} onClick={() => setCartOpen(true)}>
          <Badge badgeContent={cart.length} color="error">
            <ShoppingCart style={{ width: "50px" }} />
          </Badge>
        </IconButton>
      </Toolbar>
    </AppBar>

    {/* Product Grid */}
    <Grid container spacing={3} sx={{ marginTop: "20px",maxHeight: "79vh",overflowY: "auto",paddingRight: "5px",}}>
      {filteredProducts.map((product) => (
        <Grid item key={product.listing_id} xs={12} sm={6} md={4} lg={3}>
          <Card
            sx={{
              backgroundColor: "#2A3B5D",
              boxShadow: 3,
              borderRadius: "12px",
              cursor: "pointer",
              "&:hover": { transform: "scale(1.05)", transition: "0.3s" },
            }}
            onClick={() => handleOpenModal(product)}
          >
            <CardMedia
              component="img"
              height="140"
              image={product.image_url}
              alt={product.title}
              sx={{
                borderTopLeftRadius: "12px",
                borderTopRightRadius: "12px",
              }}
            />
            <CardContent>
              <Typography variant="h6" sx={{ color: "white", fontWeight: "bold" }}>
                {product.title}
              </Typography>
              <Typography variant="body1" color="gray">
                ${product.price}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      ))}
    </Grid>

    {/* Product Modal */}
    <Modal open={openModal} onClose={handleCloseModal}>
      <Box
        sx={{
          position: "absolute", top: "50%", left: "50%",
          transform: "translate(-50%, -50%)", width: 400,
          backgroundColor: "#1B263B", color: "white",
          padding: 4, borderRadius: "12px", boxShadow: 24,
        }}
      >
        {selectedProduct && (
          <>
            <CardMedia
              component="img"
              height="200"
              image={selectedProduct.image_url}
              alt={selectedProduct.title}
              sx={{ borderRadius: "8px" }}
            />
            <Typography variant="h5" fontWeight="bold" sx={{ marginTop: 2 }}>
              {selectedProduct.title}
            </Typography>
            <Typography variant="h6" color="lightgray" sx={{ marginTop: "10px" }}>
              ${selectedProduct.price}
            </Typography>
            <Typography variant="body1" sx={{ marginTop: "10px", color: "gray" }}>
              {selectedProduct.description}
            </Typography>

            <Box sx={{ marginTop: "20px", textAlign: "center" }}>
              <Button variant="contained" sx={{ backgroundColor: "#238636", "&:hover": { backgroundColor: "#2EA043" }, marginRight: "10px" }} onClick={() => addToCart(selectedProduct)}>
                Add to Cart
              </Button>
              <Button variant="contained" sx={{ backgroundColor: "#FF9800", "&:hover": { backgroundColor: "#E68900" } }}>
                Buy Now
              </Button>
            </Box>

            <Button onClick={handleCloseModal} sx={{ marginTop: "20px", color: "lightgray", textDecoration: "underline", display: "block", marginLeft: "auto", marginRight: "auto" }}>
              Close
            </Button>
          </>
        )}
      </Box>
    </Modal>

    {/* Cart Modal */}
    <Modal open={cartOpen} onClose={() => setCartOpen(false)}>
      <Box
        sx={{
          position: "absolute", top: "50%", left: "50%",
          transform: "translate(-50%, -50%)", width: 400,
          backgroundColor: "#1B263B", color: "white",
          padding: 4, borderRadius: "12px", boxShadow: 24,
        }}
      >
        <Typography variant="h5" fontWeight="bold">Cart</Typography>
        {cart.length === 0 ? (
          <Typography sx={{ marginTop: "10px" }}>Your cart is empty.</Typography>
        ) : (
          cart.map((item) => (
            <Box key={item.listing_id} sx={{ display: "flex", justifyContent: "space-between", marginTop: "10px" }}>
              <Typography>{item.title} - ${item.price}</Typography>
              <IconButton onClick={() => removeFromCart(item.listing_id)} sx={{ color: "red" }}>
                <RemoveShoppingCart />
              </IconButton>
            </Box>
          ))
        )}
      </Box>
    </Modal>
    <Modal open={addModalOpen} onClose={() => setAddModalOpen(false)}>
        <Box
          sx={{
            position: "absolute", top: "50%", left: "50%",
            transform: "translate(-50%, -50%)", width: 400,
            backgroundColor: "#1B263B", color: "white",
            padding: 4, borderRadius: "12px", boxShadow: 24,
          }}
        >
          <Typography variant="h5" fontWeight="bold" sx={{ mb: 2 }}>Add New Product</Typography>
          <TextField
            fullWidth
            label="Title"
            variant="outlined"
            value={newProduct.title}
            onChange={(e) => setNewProduct({ ...newProduct, title: e.target.value })}
            sx={{ mb: 2, input: { color: "white" }, label: { color: "gray" } }}
          />
          <TextField
            fullWidth
            label="Description"
            variant="outlined"
            value={newProduct.description}
            onChange={(e) => setNewProduct({ ...newProduct, description: e.target.value })}
            sx={{ mb: 2, input: { color: "white" }, label: { color: "gray" } }}
          />
          <TextField
            fullWidth
            label="Price"
            type="number"
            variant="outlined"
            value={newProduct.price}
            onChange={(e) => setNewProduct({ ...newProduct, price: e.target.value })}
            sx={{ mb: 2, input: { color: "white" }, label: { color: "gray" } }}
          />
          <TextField
            fullWidth
            label="Image URL"
            variant="outlined"
            value={newProduct.image_url}
            onChange={(e) => setNewProduct({ ...newProduct, image_url: e.target.value })}
            sx={{ mb: 2, input: { color: "white" }, label: { color: "gray" } }}
          />
          <Box sx={{ textAlign: "center" }}>
            <Button onClick={handleAddProduct} variant="contained" sx={{ backgroundColor: "#238636", "&:hover": { backgroundColor: "#2EA043" }, mr: 2 }}>
              Add Product
            </Button>
            <Button onClick={() => setAddModalOpen(false)} sx={{ color: "lightgray" }}>
              Cancel
            </Button>
          </Box>
        </Box>
      </Modal>

      {/* Floating Add Button */}
      <Fab
        color="primary"
        aria-label="add"
        sx={{
          position: "fixed",
          bottom: 30,
          right: 30,
          backgroundColor: "#238636",
          "&:hover": {
            backgroundColor: "#2EA043",
          },
        }}
        onClick={() => setAddModalOpen(true)}
      >
        <Add />
      </Fab>
  </div>
);
};

export default Marketplace;